import React, {Component} from "react";
import Tilt from 'react-parallax-tilt';
import './Logo.css';

const Logo = () => {
    return(
        <div className="ma4 mt0">
            <Tilt className="Tilt br2 shadow-2" options={{scale: 1.5}} style={{height: 150, width: 150}}>
                <div className="Tilt-inner">LOL</div>
            </Tilt>
        </div>
    );
}

export default Logo;
